import React from "react";

export default function navBar(){
    return (
    <nav classNameName="barra">
        <ul classNameName="barra__lista">
            <li className="barra__lista__item"><a className="barra__lista__item__link" href="./paginas/galeria.html"> Galeria </a></li>
            <li className="barra__lista__item"><a className="barra__lista__item__link" href="./paginas/plantas.html"> Plantas </a></li>
            <li className="barra__lista__item"><a className="barra__lista__item__link" href="./paginas/cursos.html"> Cursos </a></li>
            <li className="barra__lista__item"><a className="barra__lista__item__link" href="./paginas/tienda.html"> Tienda </a></li>
            <li className="barra__lista__item"><a className="barra__lista__item__link" href="./paginas/formulario.html"> Contacto </a></li>
        </ul>
    </nav>
    )
}
